    static constexpr int ID_return = 242;           // Regex: (return)
    static constexpr int ID_sqrt = 243;             // Regex: (sqrt)
    static constexpr int ID_else = 244;             // Regex: (else)
    static constexpr int ID_character = 245;        // Regex: '(.?)'
    static constexpr int ID_if = 246;               // Regex: (if)
    static constexpr int ID_colon = 247;            // Regex: \:
