    static constexpr int ID_char = 249;             // Regex: (char)
    static constexpr int ID_double = 250;           // Regex: (double)
    static constexpr int ID_int = 251;              // Regex: (int)
    static constexpr int ID_float = 252;            // Regex: ([0-9]+\.[0-9]*)|(\.[0-9]+)
